import React, { useState } from "react";
import { set } from "mongoose";

export default function Hooks() {
    const [count, setcount] = useState(10);

    return (
        <div>
            <div>
            <p>You clicked {count} times</p>
            </div>
            <div>
            <button onClick={()=>setcount(count + 10)}>
                click me
            </button>
            </div>
        </div>
        )
}
